import { BrowserRouter as Router, Routes, Route, Link} from "react-router-dom";
function App() {
  return (
    <Router>
      <ul>
        <li><Link><Inicio/></Link></li>
        <li><Link><Contato/></Link></li>
        <li><Link><Sobre/></Link></li>
        <li><Link><Entrar/></Link></li>
      </ul>

    </Router>
  );
}

export default App;
